import React, { Component } from 'react';
import logo from './gremlin-neptune.png';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import Paper from '@material-ui/core/Paper';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Welcome to AWS re:Invent 2018 Workshop: <br/>
            DAT310 - Building a New Graph Application Using Amazon Neptune.
          </p>
        </header>
        <p>
          <form>
            <TextField
              id="standard-full-width"
              label="Enter Gremlin Traversal:"
              style={{ margin: 8, width: 600 }}
              placeholder="<Insert Traversal Here>"
              helperText="Ex: g.V().hasLabel('movie').limit(5)"
              margin="normal"
              InputLabelProps={{
                shrink: true,
              }}
            /><br/>
            <Button variant="contained" size="medium" color="primary">
              Go!
            </Button>
          </form><br/><br/>
        </p>
        <Paper className="graph-output">

              Graph traversal output goes here...

        </Paper>
      </div>
    );
  }
}

export default App;
